                  tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,
                  quis nosasdid est laborum.</p> 
                </Col>
                <Col sm>
                  <h1 class="sta">96</h1>
                  <h2 class="chta">автомобилей</h2>
                  <hr id="sizik"></hr>
